import React from 'react';
import './App.css';
import Header from './components/Header';
import MainPage from './RoutePages/MainPage';
import {BrowserRouter as Router,Switch,Route}  from 'react-router-dom';  

function App() {
  return (
    <div className="App">
      {/* *-----------------HEADER---------------*  */}
      <Header />
      <Route path='/' component={MainPage} />
    </div>
  );
}

export default App;
